help_controls_zoom:"Zoom in / out",help_detailed_instructions:"Instru\u00e7\u00f5es detalhadas",help_p1:"Voc\u00ea \u00e9 apresentado com uma geometria de faces. Alguns rostos cont\u00eam minas (bombas), outros n\u00e3o. Se voc\u00ea clicar em uma face contendo uma bomba, voc\u00ea perde. Se voc\u00ea conseguir clicar em todas as faces (sem clicando em qualquer bomba) voc\u00ea ganha ",help_p2:"Clicar em um rosto que n\u00e3o tem uma bomba revela o n\u00famero de faces vizinhas contendo bombas. Use essas informa\u00e7\u00f5es e mais algumas suposi\u00e7\u00f5es para evitar as bombas. Os vizinhos podem ser os rostos compartilhando uma borda ou um v\u00e9rtice.",
help_p3:"Para abrir um rosto, aponte e clique com o bot\u00e3o esquerdo. Para marcar um rosto que voc\u00ea acha que \u00e9 uma bomba, aponte e clique com o bot\u00e3o direito para colocar uma bandeira. Os rostos sinalizados n\u00e3o podem ser abertos. Clique com o bot\u00e3o direito coloque um ponto de interroga\u00e7\u00e3o (Esse rosto pode ser clicado). Remova o ponto de interroga\u00e7\u00e3o clicando com o bot\u00e3o direito no rosto novamente. ",help_p4:"Os vizinhos de uma face s\u00e3o os rostos adjacentes acima, abaixo, \u00e0 esquerda, \u00e0 direita e todas as 4 diagonais, ou faces compartilhando um v\u00e9rtice com a face (V\u00e1lido em geometrias 3D). Faces nas laterais da geometria ou em um canto t\u00eam menos vizinhos. ",
help_p5:"Se voc\u00ea abrir um rosto com 0 bombas vizinhas, todos os seus vizinhos abrir\u00e3o automaticamente. Isso pode fazer com que uma grande \u00e1rea seja aberta automaticamente.",help_p6:"Para remover um marcador de bomba de um rosto, aponte para ele e clique com o bot\u00e3o direito novamente. Os rostos sinalizados n\u00e3o podem ser abertos.",help_p7:"Se voc\u00ea marcar uma bomba incorretamente, voc\u00ea ter\u00e1 que corrigir o erro antes de ganhar. A marca\u00e7\u00e3o incorreta da bomba n\u00e3o o mata, mas pode levar a erros que o fazem.",
help_p8:"Voc\u00ea n\u00e3o precisa marcar todas as bombas para ganhar; voc\u00ea s\u00f3 precisa abrir todas as caras que n\u00e3o sejam bombas.",help_p9:"Clicar duas vezes com o bot\u00e3o direito dar\u00e1 a voc\u00ea um s\u00edmbolo de ponto de interroga\u00e7\u00e3o que pode ser \u00fatil se voc\u00ea n\u00e3o tiver certeza sobre um quadrado. Clique com o bot\u00e3o direito novamente para remover o ponto de interroga\u00e7\u00e3o.",help_quick_start:"In\u00edcio r\u00e1pido",import_fatal_error_content:"A biblioteca {0} n\u00e3o p\u00f4de ser importada do caminho {1}",
